import{_ as a,c as o,o as t,ad as c}from"./chunks/framework.C2hRbcpH.js";const u=JSON.parse('{"title":"📠 Change Log","description":"","frontmatter":{},"headers":[],"relativePath":"en-US/guide/changelog.md","filePath":"en-US/guide/changelog.md","lastUpdated":1756748655000}'),i={name:"en-US/guide/changelog.md"};function d(l,e,r,n,s,h){return t(),o("div",null,e[0]||(e[0]=[c('<h1 id="📠-change-log" tabindex="-1">📠 Change Log <a class="header-anchor" href="#📠-change-log" aria-label="Permalink to “📠 Change Log”">​</a></h1><h2 id="_10-0-0-alpha9" tabindex="-1">10.0.0-alpha9 <a class="header-anchor" href="#_10-0-0-alpha9" aria-label="Permalink to “10.0.0-alpha9”">​</a></h2><p><code>2025-09-02</code></p><ul><li>👉 Change the return value of the indicator method <code>calc</code> from an array to an object keyed by a timestamp.</li><li>💄 Optimize indicator calculation task execution.</li><li>🐞 Fix an issue where the instance APIs <code>setSymbol</code>, <code>setPeriod</code>, and <code>setDataLoader</code> did not reset the Y axis.</li></ul><h2 id="_10-0-0-alpha8" tabindex="-1">10.0.0-alpha8 <a class="header-anchor" href="#_10-0-0-alpha8" aria-label="Permalink to “10.0.0-alpha8”">​</a></h2><p><code>2025-06-14</code></p><ul><li>🐞 Fix typescript reference error.</li></ul><h2 id="_10-0-0-alpha7" tabindex="-1">10.0.0-alpha7 <a class="header-anchor" href="#_10-0-0-alpha7" aria-label="Permalink to “10.0.0-alpha7”">​</a></h2><p><code>2025-06-14</code></p><ul><li>👉 Chart api <code>init(ds, options)</code> , <code>options.customApi</code> changed to <code>options.formatter</code> , <code>formatDate</code> parameter changed to object.</li><li>👉 Instance api <code>setCustomApi</code> changed to <code>setFormatter</code> , <code>getCustomApi</code> changed to <code>getFormatter</code>.</li><li>🆕 Style configuration add <code>candle.priceMark.last.extendTexts</code> , <code>candle.tooltip.title</code> , <code>candle.tooltip.legend</code> , <code>indicator.tooltip.title</code> , <code>indicator.tooltip.legend</code> and <code>crosshair.horizontal.features</code> .</li><li>🆕 Instance api add <code>setDataLoader</code> , <code>setSymbol</code> , <code>getSymbol</code> , <code>setPeriod</code> , <code>getPeriod</code> and <code>resetData</code> .</li><li>🆕 Instance api <code>subscribeAction</code> and <code>unsubscribeAction</code> params add <code>onIndicatorTooltipFeatureClick</code> and <code>onCrosshairFeatureClick</code> .</li><li>🗑 Remove <code>candle.tooltip.defaultValue</code> in style configuration, replace <code>candle.tooltip.custom</code> with <code>candle.tooltip.legend</code>, remove <code>candle.tooltip.text</code>, remove <code>indicator.tooltip.showName</code>, <code>indicator.tooltip.showParams</code>, use <code>indicator.tooltip.title</code>, remove <code>indicator.tooltip.defaultValue</code>, replace with <code>indicator.tooltip.legend</code>, remove <code>indicator.tooltip.text</code>.</li><li>🗑 Remove <code>setLoadMoreData</code> , <code>applyNewData</code> , <code>updateData</code> in instance api, replace with <code>setDataLoader</code>, remove <code>clearData</code>, <code>setPrecision</code> and <code>getPrecision</code> .</li><li>🐞 Fix the confusion of overlay <code>onSelected</code> and <code>onDeselected</code> responses.</li><li>🐞 Fix the display problem when the style configuration <code>candle.type</code> is <code>ohlc</code> .</li><li>💄 Optimize the default event response of overlay events.</li><li>💄 Optimize the x-axis display.</li></ul><h2 id="_10-0-0-alpha6" tabindex="-1">10.0.0-alpha6 <a class="header-anchor" href="#_10-0-0-alpha6" aria-label="Permalink to “10.0.0-alpha6”">​</a></h2><p><code>2025-06-12</code></p><ul><li>Error publish.</li></ul><h2 id="_10-0-0-alpha5" tabindex="-1">10.0.0-alpha5 <a class="header-anchor" href="#_10-0-0-alpha5" aria-label="Permalink to “10.0.0-alpha5”">​</a></h2><p><code>2025-03-09</code></p><ul><li>👉 Style configuration <code>candle.tooltip.icons</code> changed to <code>candle.tooltip.features</code>, <code>indicator.tooltip.icons</code> changed to <code>indicator.tooltip.features</code>.</li><li>👉 <code>icons</code> in the return value of the <code>createTooltipDataSource</code> method in the indicator changed to <code>features</code>.</li><li>👉 The instance api <code>subscribeAction</code> and <code>unsubscribeAction</code> input parameter <code>onTooltipIconClick</code> changed to <code>onCandleTooltipFeatureClick</code>, and the indicator event is replaced by <code>indicator.onClick</code>.</li><li>🐞 Fixed the problem that scrolling cannot be performed in certain situations on mobile terminals.</li><li>💄 Optimize the display of overlay event response.</li></ul><h2 id="_10-0-0-alpha4" tabindex="-1">10.0.0-alpha4 <a class="header-anchor" href="#_10-0-0-alpha4" aria-label="Permalink to “10.0.0-alpha4”">​</a></h2><p><code>2025-02-23</code></p><ul><li>🐞 Fix the issue that the parameter <code>more.backward</code> of <code>applyNewData</code> instance method is incorrect.</li><li>🐞 Fix the issue that a single piece of data causes a chart error.</li></ul><h2 id="_10-0-0-alpha3" tabindex="-1">10.0.0-alpha3 <a class="header-anchor" href="#_10-0-0-alpha3" aria-label="Permalink to “10.0.0-alpha3”">​</a></h2><p><code>2025-02-19</code></p><ul><li>👉 The return value of the instance api <code>createIndicator</code> is changed to return the indicator id.</li><li>👉 The input parameter <code>paneId</code> of the instance api <code>overlayIndicator</code> is merged into the input parameter <code>indicator</code>.</li><li>👉 The return value of the instance api <code>getIndicators</code> is changed to return an array.</li><li>👉 The return value of the instance api <code>getOverlays</code> is changed to return an array.</li><li>🆕 The style configuration adds <code>candle.bar.compareRule</code>, <code>indicator.ohlc.compareRule</code> and <code>candle.priceMark.last.compareRule</code>.</li><li>🆕 Supports dragging the y-axis on mobile devices.</li><li>🆕 Supports creating multiple indicators with the same name on the same window.</li><li>💄 Optimize <code>figure</code> in <code>overlay</code> template to ignore event type, and the event name is consistent with the event name in <code>overlay</code>.</li><li>🐞 Fix the problem that the indicator custom prompt information may be wrong.</li><li>🐞 Fix the problem that the overlay being drawn may not be deleted correctly.</li><li>🐞 Fix the problem that the api <code>createOverlay</code> may not be created correctly when <code>points</code> is specified.</li><li>🐞 Fix the problem that the api <code>executeAction</code> may cause the <code>subscribeAction</code> to trigger infinitely.</li></ul><h2 id="_10-0-0-alpha2" tabindex="-1">10.0.0-alpha2 <a class="header-anchor" href="#_10-0-0-alpha2" aria-label="Permalink to “10.0.0-alpha2”">​</a></h2><p><code>2024-12-20</code></p><ul><li>🆕 The x-axis supports displaying future time.</li><li>🐞 Fix the issue that <code>subscribeAction</code> type is <code>ActionType.OnCandleBarClick</code> and it does not work.</li></ul><h2 id="_10-0-0-alpha1" tabindex="-1">10.0.0-alpha1 <a class="header-anchor" href="#_10-0-0-alpha1" aria-label="Permalink to “10.0.0-alpha1”">​</a></h2><p><code>2024-12-01</code></p><ul><li>🆕 New features <ul><li>Support thousand separators and custom decimal folding.</li><li>Rewrite the axis module, and customize the y-axis to support setting ranges.</li><li>Add instance methods <code>setPrecision(precision)</code> , <code>getPrecision()</code> , <code>setThousandsSeparator(thousandsSeparator)</code> , <code>getThousandsSeparator()</code> , <code>setDecimalFold(decimalFold)</code> , <code>getDecimalFold()</code> and <code>setLoadMoreDataCallback(cb)</code> .</li></ul></li><li>👉 Changes <ul><li>Chart api <code>init(dcs, options)</code>, <code>position</code> in <code>options.layout</code> child changed to <code>order</code> , <code>formatDate(dateTimeFormat, timestamp, format, type)</code> in <code>options.customApi</code> changed to <code>formatDate(timestamp, format, type)</code> , <code>options.thousandsSeparator</code> changed to object <code>{ sign, format }</code> , <code>options.decimalFoldThreshold</code> changed to <code>options.decimalFold</code> .</li><li>Instance api <code>applyNewData(dataList, more, callback)</code> changed to <code>applyNewData(dataList, more)</code> .</li><li>Instance api <code>updateData(data, callback)</code> changed to <code>updateData(data)</code> .</li><li>Instance api <code>getBarSpace()</code> return value changed to object.</li><li>The return value of the custom indicator <code>createTooltipDataSource</code> method <code>values</code> is changed to <code>legends</code> .</li></ul></li><li>🗑 Deprecated <ul><li>Remove chart api <code>utils.drawArc(ctx, arc, styles)</code>, <code>utils.drawCircle(ctx, circle, styles)</code>, <code>utils.drawLine(ctx, line, styles)</code>, <code>utils.drawPolygon(ctx, polygon, styles)</code>, <code>utils.drawRect(ctx, rect, styles)</code>, <code>utils.drawText(ctx, text, styles)</code>, <code>utils.drawRectText(ctx, rectText, styles)</code>, please use <code>getFigureClass(name)</code> instead.</li><li>Remove instance api <code>setPriceVolumePrecision(pricePrecision, volumePrecision)</code>, please use <code>setPrecision(precision)</code> instead.</li><li>Remove instance api <code>applyMoreData(dataList, more, callback)</code>, <code>setLoadDataCallback(cb)</code> and <code>loadMore(cb)</code>, please use <code>setLoadMoreDataCallback(cb)</code> instead.</li><li>Remove instance api <code>getIndicatorByPaneId(paneId, name)</code>, please use <code>getIndicators(filter)</code> instead.</li><li>Remove instance api <code>getOverlayById(id)</code>, please use <code>getOverlays(filter)</code> instead.</li><li>Remove style configuration <code>yAxis.position</code> , <code>yAxis.type</code> , <code>yAxis.inside</code> and <code>yAxis.inside</code> , please use the properties in the window configuration <code>axis</code> instead. For details, refer to the chart API <a href="/api/chart/init#parameters">init(dcs, options)</a>, the instance API <a href="/api/instance/createIndicator#parameters">createIndicator(value, isStack, paneOptions)</a> and <a href="/api/instance/setPaneOptions#parameters">setPaneOptions(options)</a>.</li><li>Remove <code>overlay.rectText</code> from style configuration.</li><li>Remove <code>rectText</code> from built-in basic graphics, please use <code>text</code> instead.</li></ul></li></ul><h2 id="_9-x" tabindex="-1">9.x <a class="header-anchor" href="#_9-x" aria-label="Permalink to “9.x”">​</a></h2><p>Go to <a href="https://v9.klinecharts.com" target="_blank" rel="noreferrer">https://v9.klinecharts.com</a> to check the change log for 9.x.</p><h2 id="_8-x" tabindex="-1">8.x <a class="header-anchor" href="#_8-x" aria-label="Permalink to “8.x”">​</a></h2><p>Go to <a href="https://v8.klinecharts.com" target="_blank" rel="noreferrer">https://v8.klinecharts.com</a> to check the change log for 9.x.</p><h2 id="_7-x" tabindex="-1">7.x <a class="header-anchor" href="#_7-x" aria-label="Permalink to “7.x”">​</a></h2><p>Go to <a href="https://github.com/liihuu/KLineChart/blob/v7.5.0/docs/en/changelog.md" target="_blank" rel="noreferrer">Github</a> to check the change log for 7.x.</p><h2 id="_6-x" tabindex="-1">6.x <a class="header-anchor" href="#_6-x" aria-label="Permalink to “6.x”">​</a></h2><p>Go to <a href="https://github.com/liihuu/KLineChart/blob/v6.1.0/docs/en/CHANGELOG.md" target="_blank" rel="noreferrer">Github</a> to check the change log for 6.x.</p><h2 id="_5-x" tabindex="-1">5.x <a class="header-anchor" href="#_5-x" aria-label="Permalink to “5.x”">​</a></h2><p>Go to <a href="https://github.com/liihuu/KLineChart/releases/tag/v5.0.0" target="_blank" rel="noreferrer">Github</a> to view the 5.x release notes.</p><h2 id="_4-x" tabindex="-1">4.x <a class="header-anchor" href="#_4-x" aria-label="Permalink to “4.x”">​</a></h2><p>Go to <a href="https://github.com/liihuu/KLineChart/releases/tag/v4.0.0" target="_blank" rel="noreferrer">Github</a> to view the 4.x release notes.</p>',40)]))}const m=a(i,[["render",d]]);export{u as __pageData,m as default};
